(window.webpackJsonp=window.webpackJsonp||[]).push([[113],{136:function(p){p.exports={chapterTitle:null,title:"\u7b2c11\u7ae0 \u8c01\u4e5f\u4e0d\u66fe\u53d1\u73b0\u7684\u79d8\u5bc6",content:"<article><h2>\u7b2c11\u7ae0 \u8c01\u4e5f\u4e0d\u66fe\u53d1\u73b0\u7684\u79d8\u5bc6</h2><p>\u3000\u3000\u5f20\u606a\u4e0d\u5fcd\u5fc3\u770b\u7740\u5510\u5a67\u7ee7\u7eed\u714e\u71ac\u4e0b\u53bb\uff0c\u51b3\u5b9a\u591a\u900f\u9732\u4e00\u70b9\u771f\u76f8\u7ed9\u987e\u5efa\u840d\u4e0e\u5510\u5a67\uff0c\u770b\u7740\u987e\u5efa\u840d\u8fdb\u6765\uff1a\u201c\u53f6\u79d8\u4e66\u5e26\u8fc7\u6765\u7684\u7167\u7247\u91cc\u662f\u4e0d\u662f\u6709\u4e00\u622a\u9662\u5899\uff0c\u540e\u9762\u6709\u6761\u6cb3\uff0c\u4e24\u4eba\u5f88\u968f\u610f\u7684\u8d70\u5728\u8def\u4e0a\uff0c\u4ece\u5510\u4f2f\u4f2f\u7684\u89d2\u5ea6\u6765\u770b\uff0c\u8bf4\u662f\u5077\u62cd\u4e5f\u6709\u53ef\u80fd\uff0c\u4f46\u662f\u90a3\u4e2a\u5973\u5b50\u5374\u6ce8\u89c6\u7740\u955c\u5934\uff0c\u53f6\u79d8\u4e66\u5e26\u6765\u7684\u662f\u4e0d\u662f\u8fd9\u5f20\u7167\u7247\uff1f\u201d</p><p>\u3000\u3000\u201c\u4ec0\u4e48\uff0c\u4f60\u89c1\u8fc7\u8fd9\u5f20\u7167\u7247\uff1f\u201d\u987e\u5efa\u840d\u5bf9\u5973\u513f\u8bf4\uff0c\u201c\u5c0f\u5a67\uff0c\u7167\u7247\u662f\u5988\u5988\u6795\u5934\u4e0b\u9762\uff0c\u4f60\u53bb\u62ff\u8fc7\u6765\u2026\u2026\u201d</p><p>\u3000\u3000\u679c\u7136\u662f\u8bb8\u601d\u90a3\u53e0\u7167\u7247\u4e2d\u7684\u4e00\u5f20\uff0c\u5f20\u606a\u5e73\u9759\u7684\u8bf4\uff1a\u201c\u6211\u8ddf\u7238\u7238\u89c1\u8fc7\u4e00\u5f20\u8ddf\u8fd9\u5dee\u4e0d\u591a\uff0c\u7238\u7238\u8bf4\u90a3\u65f6\u662f\u5510\u4f2f\u4f2f\u8ddf\u8fd9\u4e2a\u5973\u4eba\u5728\u8c08\u5de5\u4f5c\uff0c\u8bf4\u660e\u4e0d\u4e86\u4ec0\u4e48\u2026\u2026\u201d</p><p>\u3000\u3000\u201c\u6709\u8fd9\u6837\u7684\u5de5\u4f5c\u7167\uff1f\u201d\u987e\u5efa\u840d\u770b\u89c1\u7167\u7247\u91cc\u4e08\u592b\u7684\u773c\u795e\u7ed9\u7c98\u5728\u8bb8\u601d\u8eab\u4e0a\u4f3c\u7684\uff0c\u5fc3\u91cc\u4e0d\u662f\u6ecb\u5473\u3002</p><p>\u3000\u3000\u5f20\u606a\u6000\u7591\u8fd9\u7cfb\u5217\u7167\u7247\u53ef\u80fd\u662f\u5510\u5b66\u8c26\u4e0d\u77e5\u60c5\u7684\u60c5\u51b5\u88ab\u4eba\u5077\u62cd\u7684\uff0c\u5f53\u7136\uff0c\u8bb8\u601d\u5e94\u8be5\u662f\u77e5\u60c5\u7684\uff0c\u6240\u4ee5\u5f53\u5077\u62cd\u8005\u6309\u52a8\u5feb\u95e8\u65f6\uff0c\u5979\u4f1a\u7ed9\u770b\u5411\u955c\u5934\uff0c\u7ed9\u4eba\u9020\u6210\u8fd9\u662f\u5f88\u81ea\u7136\u7684\u751f\u6d3b\u7167\u7684\u611f\u89c9\u3002\u4f46\u5510\u5b66\u8c26\u4e5f\u771f\u662f\u7684\uff0c\u504f\u504f\u6bcf\u4e00\u5f20\u7167\u7247\u90fd\u8086\u65e0\u5fcc\u60ee\u7684\u6ce8\u89c6\u7740\u8bb8\u601d\uff0c\u5927\u6982\u8fd9\u662f\u4e24\u4eba\u72ec\u5904\u65f6\uff0c\u52a0\u4e0a\u8bb8\u601d\u53c8\u8bf4\u4e86\u4e00\u4e9b\u6311\u9017\u7684\u8bdd\u7684\u7f18\u6545\u3002</p><p>\u3000\u3000\u5f20\u606a\u8981\u60f3\u529e\u6cd5\u628a\u8bb8\u601d\u4ece\u8fd9\u6f6d\u6d51\u6c34\u91cc\u62c9\u4e0a\u6765\uff0c\u8fd9\u65f6\u5019\u5c31\u4e0d\u80fd\u8bf4\u5979\u7684\u574f\u8bdd\uff0c\u8981\u77e5\u9053\u5973\u4eba\u7684\u6267\u8457\u662f\u5f88\u6050\u6016\u7684\u3002</p><p>\u3000\u3000\u201c\u4e5f\u8bb8\u6709\u4eba\u60f3\u5c06\u810f\u6c34\u6cfc\u5230\u5510\u4f2f\u4f2f\u8eab\u4e0a\uff0c\u6211\u770b\u8fd9\u7167\u7247\u50cf\u662f\u5077\u62cd\u7684\uff0c\u8d81\u5510\u4f2f\u4f2f\u8ddf\u8fd9\u4e2a\u5973\u4eba\u8c08\u5de5\u4f5c\u7684\u65f6\u5019\u5077\u62cd\u7684\uff0c\u201d\u5f20\u606a\u6307\u7740\u7167\u7247\u4e0a\u7684\u8bb8\u601d\uff0c\u51b7\u9759\u7684\u770b\u7740\u987e\u5efa\u840d\uff0c\u4ed6\u8981\u8ba9\u987e\u5efa\u840d\u660e\u767d\uff0c\u6bd4\u8d77\u4e89\u98ce\u5403\u918b\uff0c\u5e2e\u5510\u5b66\u8c26\u6d17\u8131\u7f6a\u540d\u66f4\u91cd\u8981\uff0c\u201c\u8fd9\u7167\u7247\u600e\u4e48\u5230\u53f6\u79d8\u4e66\u624b\u91cc\uff1f\u6211\u7238\u7238\u8bf4\u53f6\u79d8\u4e66\u8fd9\u4eba\u4e0d\u53ef\u9760\u2026\u2026\u4ed6\u662f\u600e\u4e48\u8ddf\u963f\u59e8\u63d0\u8d77\u6211\u7238\u7238\u53bb\u4e1c\u793e\u7684\u4e8b\u60c5\u7684\uff1f\u201d</p><p>\u3000\u3000\u201c\u8bf4\u4f60\u7238\u7238\u6015\u88ab\u7275\u8fde\uff0c\u8d81\u7740\u7ed9\u4f60\u53d4\u7237\u7237\u529e\u4e27\u4e8b\u7684\u673a\u4f1a\uff0c\u8eb2\u5230\u4e1c\u793e\u53bb\u4e86\uff0c\u8fd8\u8bf4\u662f\u8bf7\u4e86\u5341\u5929\u7684\u5047\uff0c\u6211\u8bf4\u5947\u602a\u5462\uff0c\u4e3a\u4ec0\u4e48\u8981\u8bf7\u5341\u5929\u7684\u5047\uff1f\u201d\u987e\u5efa\u840d\u4e5f\u5fc3\u751f\u7591\u8651\uff0c\u5979\u6bd5\u7adf\u4e0d\u662f\u7b28\u5973\u4eba\uff0c\u53ea\u662f\u7ed9\u770b\u5230\u7167\u7247\u91cc\u7684\u8bb8\u601d\uff0c\u795e\u7ecf\u5dee\u70b9\u7ed9\u903c\u75af\u4e86\u3002</p><p>\u3000\u3000\u201c\u5728\u8fd9\u4e4b\u524d\uff0c\u53f6\u79d8\u4e66\u627e\u6211\u7238\u7238\u8bf4\u5510\u4f2f\u4f2f\u8981\u6211\u7238\u7238\u51fa\u53bb\u907f\u4e00\u907f\uff0c\u6211\u7238\u7238\u662f\u6e05\u695a\u5510\u4f2f\u4f2f\u7684\u4e3a\u4eba\uff0c\u4ece\u53f6\u79d8\u4e66\u5e26\u7684\u8bdd\u91cc\uff0c\u5c31\u77e5\u9053\u4ed6\u8fd9\u4eba\u4e0d\u53ef\u9760\u3002\u6211\u7238\u7238\u662f\u8bf7\u4e86\u5341\u5929\u7684\u5047\uff0c\u4f46\u4e0d\u662f\u8eb2\u5230\u4e1c\u793e\uff0c\u6211\u7238\u7238\u7559\u5728\u5e02\u91cc\u5e72\u7740\u6025\uff0c\u505a\u4ec0\u4e48\u4e8b\u90fd\u7ed9\u6709\u5fc3\u4eba\u76ef\u7740\uff0c\u624d\u60f3\u5230\u53bb\u4e1c\u793e\u8eb2\u5f00\u6709\u5fc3\u4eba\u7684\u773c\u5149\uff0c\u8fd9\u6837\u624d\u80fd\u67e5\u51fa\u6765\u662f\u8c01\u6709\u4eba\u5f80\u5510\u4f2f\u4f2f\u8eab\u4e0a\u6cfc\u810f\u6c34\u2026\u2026\u201d</p><p>\u3000\u3000\u201c\u4e00\u5b9a\u662f\u6709\u4eba\u5f80\u4f60\u5510\u4f2f\u4f2f\u8eab\u4e0a\u6cfc\u6c61\u6c34\uff0c\u201d\u987e\u5efa\u840d\u8f6f\u5f31\u7684\u5750\u5230\u5e8a\u4e0a\uff0c\u5c0f\u58f0\u54ed\u8d77\u6765\uff0c\u770b\u5728\u5979\u5fc3\u91cc\u627f\u53d7\u7684\u538b\u529b\u5df2\u7ecf\u591f\u591a\u4e86\uff0c\u624d\u4e0d\u987e\u4eea\u6001\u5728\u5973\u513f\u4e0e\u5f20\u606a\u9762\u524d\u54ed\u6ce3\u8d77\u6765\uff0c\u201c\u8fd9\u526f\u5e02\u957f\u6709\u4ec0\u4e48\u597d\u5f53\u4e86\uff0c\u6ca1\u6709\u4e00\u5929\u80fd\u597d\u597d\u7684\u5403\u4e00\u987f\u996d\uff0c\u597d\u597d\u7684\u7761\u4e00\u6b21\u89c9\uff0c\u505a\u7684\u4e8b\u8fd8\u8ba9\u8fd9\u4e48\u591a\u7684\u4eba\u8bb0\u6068\u7740\uff0c\u8fd9\u6b21\u5012\u597d\uff0c\u4ed6\u4eec\u662f\u8981\u628a\u4f60\u5510\u4f2f\u4f2f\u5f80\u6b7b\u91cc\u6574\u554a\u2026\u2026\u201d</p><p>\u3000\u3000\u5f20\u606a\u4e0d\u6562\u8ddf\u987e\u5efa\u840d\u8bf4\u5b9e\u60c5\uff0c\u6015\u5979\u6c89\u4e0d\u4f4f\u6c14\u3002</p><p>\u3000\u3000\u201c\u554a\uff0c\u53f6\u79d8\u4e66\u521a\u521a\u628a\u4f60\u5510\u4f2f\u4f2f\u7684\u4e00\u4e9b\u6587\u4ef6\u62ff\u8d70\u4e86\u2026\u2026\u201d\u987e\u5efa\u840d\u624d\u60f3\u8d77\u8fd9\u4ef6\u4e8b\u3002</p><p>\u3000\u3000\u5f20\u606a\u5fc3\u91cc\u65e0\u5948\u7684\u7b11\u4e86\u7b11\uff0c\u95ee\u5979\uff0c\u201c\u4ed6\u90fd\u62ff\u8d70\u54ea\u4e9b\u4e1c\u897f\uff1f\u201d</p><p>\u3000\u3000\u201c\u90fd\u662f\u4f60\u5510\u4f2f\u4f2f\u5728\u5bb6\u968f\u624b\u8bb0\u4e0b\u7684\u4e1c\u897f\uff0c\u5de5\u4f5c\u65e5\u5fd7\u4e4b\u7c7b\u7684\uff0c\u62ff\u8d70\u4e86\u4e24\u4e09\u672c\u7b14\u8bb0\u672c\uff0c\u8fd8\u6709\u4e00\u53e0\u7a3f\u7eb8\u2026\u2026\u201d\u987e\u5efa\u840d\u7a81\u7136\u4f9d\u8d56\u8d77\u773c\u524d\u8fd9\u4e2a\u5c11\u5e74\uff0c\u7d27\u5f20\u7684\u95ee\u201c\u8fd9\u4e9b\u662f\u4e0d\u662f\u5f88\u91cd\u8981\uff1f\u201d</p><p>\u3000\u3000\u201c\u6211\u7238\u7238\u4e5f\u8ba9\u6211\u8fc7\u6765\u62ff\u8fd9\u4e9b\u4e1c\u897f\uff0c\u770b\u770b\u5510\u4f2f\u4f2f\u5de5\u4f5c\u6709\u6ca1\u6709\u5f97\u7f6a\u4ec0\u4e48\u4eba\uff0c\u6216\u8bb8\u80fd\u627e\u5230\u8c01\u5f80\u5510\u4f2f\u4f2f\u8eab\u4e0a\u6cfc\u810f\u6c34\uff1f\u201d\u5f20\u606a\u8bf4\u9053\uff0c\u201c\u5012\u4e0d\u662f\u5f88\u91cd\u8981\uff0c\u65e2\u7136\u8ba9\u53f6\u79d8\u4e66\u62ff\u8d70\u4e86\uff0c\u60f3\u5fc5\u4e5f\u8981\u4e0d\u56de\u6765\u4e86\uff0c\u987e\u963f\u59e8\uff0c\u5510\u4f2f\u4f2f\u6709\u6ca1\u6709\u628a\u5176\u4ed6\u4ec0\u4e48\u4e1c\u897f\u653e\u5728\u5bb6\u91cc\uff1f\u201d</p><p>\u3000\u3000\u201c\u4f60\u5510\u4f2f\u4f2f\u7684\u5de5\u4f5c\uff0c\u6211\u4e5f\u4e0d\u7ba1\u7684\uff0c\u8981\u4e0d\u53bb\u4ed6\u4e66\u623f\u770b\u770b\uff0c\u80fd\u4e0d\u80fd\u518d\u627e\u5230\u4e9b\u4ec0\u4e48\uff1f\u201d</p><p>\u3000\u3000\u5510\u5b66\u8c26\u5bb6\u6ca1\u5c11\u6765\u8fc7\uff0c\u4f46\u662f\u4ed6\u7684\u4e66\u623f\u5374\u6ca1\u8fdb\u6765\u8fc7\uff0c\u5c31\u7b97\u7238\u7238\u4e5f\u662f\u975e\u9080\u8bf7\u4e0d\u80fd\u8fdb\u7684\uff0c\u4e24\u6392\u9876\u5230\u5929\u82b1\u677f\u7684\u4e66\u67b6\u9760\u7740\u4e1c\u897f\u5899\u58c1\uff0c\u5de6\u8fb9\u7684\u4e66\u67b6\u6446\u6ee1\u5404\u79cd\u5404\u6837\u7684\u4e66\u7c4d\u56fe\u518c\uff0c\u53f3\u8fb9\u7684\u4e66\u67b6\u6446\u7740\u65e7\u4e66\u4e0e\u5404\u5f0f\u74f7\u5668\uff0c\u4e00\u76ee\u4e86\u7136\u3002\u5510\u5b66\u8c26\u6709\u6536\u85cf\u74f7\u5668\u4e0e\u65e7\u4e66\u7684\u559c\u597d\uff0c\u5bb6\u91cc\u6536\u85cf\u7684\u74f7\u5668\u6709\u4ed6\u81ea\u5df1\u4ece\u53e4\u7269\u5e02\u573a\u6dd8\u56de\u6765\u7684\uff0c\u6709\u4e03\u5341\u5e74\u4e0a\u5c71\u4e0b\u4e61\u6536\u96c6\u7684\uff0c\u4e5f\u4e0d\u4e4f\u670b\u53cb\u4e0b\u5c5e\u8d60\u9001\u7684\uff0c\u5e78\u597d\u6ca1\u6709\u4ec0\u4e48\u73cd\u54c1\u3002</p><p>\u3000\u3000\u5de6\u8fb9\u7684\u4e66\u67b6\u6709\u7ffb\u52a8\u7684\u75d5\u8ff9\uff0c\u5374\u662f\u53f3\u8fb9\u6446\u74f7\u5668\u4e0e\u65e7\u4e66\u7684\u4e66\u67b6\u4e95\u7136\u6709\u5e8f\uff0c\u60f3\u5fc5\u53f6\u65b0\u660e\u8ba4\u4e3a\u4ed6\u8981\u627e\u7684\u4e1c\u897f\u4e0d\u4f1a\u5728\u90a3\u91cc\uff0c\u5f20\u606a\u8d70\u5230\u8fd1\u5904\uff0c\u76ee\u5149\u5728\u74f7\u5668\u4e0e\u65e7\u4e66\u5de1\u89c6\uff0c\u624b\u6307\u6ed1\u8fc7\u7834\u65e7\u7684\u4e66\u810a\uff0c\u4ece\u6700\u4e0d\u8d77\u773c\u7684\u89d2\u843d\u91cc\u62bd\u51fa\u4e00\u672c\u518c\u5b50\uff0c\u662f\u90a3\u79cd\u571f\u9ec4\u8272\u5c01\u9762\u7684\u8bb0\u4e8b\u672c\uff0c\u4e66\u810a\u4e0a\u78e8\u6bdb\u4e86\u8fb9\uff0c\u6709\u4e9b\u7834\u76ae\uff0c\u8ddf\u65e7\u4e66\u6df7\u5728\u4e00\u8d77\uff0c\u4e0d\u4ed4\u7ec6\u5206\u8fa8\u4e0d\u51fa\u6765\u3002</p><p>\u3000\u3000\u8bb0\u4e8b\u672c\u7684\u6249\u9875\u7528\u84dd\u58a8\u6c34\u5199\u7740\u201c\u66fe\u5efa\u534e\u201d\u8fd9\u4e2a\u540d\u5b57\uff0c\u7b14\u753b\u5f88\u7c97\uff0c\u540d\u5b57\u4e0b\u9762\u8fd8\u6709\u65e5\u671f\uff0c\u201c91.3\u201d\uff0c\u5f20\u606a\u7684\u5370\u8c61\u91cc\u6ca1\u6709\u8fd9\u4e2a\u540d\u5b57\uff0c\u7ffb\u4e86\u51e0\u9875\uff0c\u6d41\u6c34\u8d26\u7684\u8bb0\u5f55\u4e86\u4e00\u4e9b\u4f3c\u4e4e\u8d22\u52a1\u4e0a\u7684\u5de5\u4f5c\uff0c\u5f88\u7410\u788e\uff0c\u5e94\u8be5\u662f\u66fe\u5efa\u534e\u8fd9\u4e2a\u4eba\u7684\u4e2a\u4eba\u5de5\u4f5c\u65e5\u8bb0\uff0c\u5f20\u606a\u5feb\u901f\u7ffb\u4e86\u4e00\u904d\uff0c\u4e0a\u9762\u6ca1\u6709\u654f\u611f\u7684\u5b57\u773c\u3002</p><p>\u3000\u3000\u5f20\u606a\u5728\u9686\u88d5\u96c6\u56e2\u5de5\u4f5c\u65f6\uff0c\u5f88\u591a\u89c1\u4e0d\u5f97\u5149\u7684\u4e8b\u60c5\u90fd\u4f1a\u7528\u9690\u8bb3\u7684\u8bcd\u8bed\u4ee3\u66ff\uff0c\u53ea\u8981\u81ea\u5df1\u80fd\u770b\u660e\u767d\u5c31\u53ef\u4ee5\u4e86\uff0c\u8fd9\u672c\u8bb0\u4e8b\u672c\u8981\u62ff\u56de\u53bb\u597d\u597d\u7814\u7a76\u624d\u884c\u3002\u518d\u6ca1\u627e\u5230\u5176\u4ed6\u6709\u7528\u7684\u4e1c\u897f\uff0c\u770b\u6765\u8fd9\u672c\u8bb0\u4e8b\u672c\u8fd8\u662f\u53f6\u65b0\u660e\u9519\u8fc7\u773c\u7684\u3002</p><p>\u3000\u3000\u201c\u987e\u963f\u59e8\uff0c\u5510\u4f2f\u4f2f\u4e00\u5b9a\u4f1a\u6ca1\u4e8b\u7684\u3002\u6211\u7238\u7238\u9700\u8981\u5728\u522b\u4eba\u4e0d\u6ce8\u610f\u7684\u65f6\u5019\u6536\u96c6\u8bc1\u636e\uff0c\u987e\u963f\u59e8\u5343\u4e07\u4e0d\u8981\u8ddf\u522b\u4eba\u8bf4\u6211\u7238\u7238\u5728\u8c03\u67e5\u8fd9\u4ef6\u4e8b\uff0c\u6bd5\u7adf\u73b0\u5728\u8fd8\u4e0d\u6e05\u695a\u8c01\u5728\u5f80\u5510\u4f2f\u4f2f\u8eab\u4e0a\u6cfc\u6c61\u6c34\u2026\u2026\u201d\u5f20\u606a\u770b\u4e86\u5510\u5a67\u4e00\u773c\uff0c\u867d\u7136\u6e05\u7626\u4e86\u8bb8\u591a\uff0c\u4f46\u8fd8\u662f\u5f88\u7f8e\uff0c\u4e0d\u4ec5\u6709\u5c11\u5973\u7684\u6e05\u79c0\uff0c\u7709\u773c\u95f4\u8fd8\u6709\u80a1\u5b50\u5a9a\u6c14\u3002</p><p>\u3000\u3000\u542c\u5f20\u606a\u5206\u6790\u5230\u73b0\u5728\uff0c\u5979\u5bf9\u81ea\u5df1\u7684\u7238\u7238\u53c8\u91cd\u65b0\u63d0\u8d77\u4fe1\u5fc3\uff0c\u8138\u4e0a\u6e10\u6e10\u6709\u4e86\u4e00\u4e9b\u8840\u8272\uff0c\u7f8e\u4e3d\u7684\u773c\u7738\u51dd\u7740\u6c34\u4e00\u6837\u7684\u6ce8\u89c6\u5f20\u606a\u3002\u5f20\u606a\u60f3\u8ddf\u5979\u8bf4\u8bf4\u8bdd\uff0c\u56e0\u4e3a\u7701\u68c0\u67e5\u7ec4\u9a6c\u4e0a\u5c31\u4f1a\u589e\u52a0\u8c03\u67e5\u7684\u529b\u5ea6\uff0c\u5305\u62ec\u8bf7\u987e\u5efa\u840d\u63a5\u53d7\u8c03\u67e5\u3001\u641c\u67e5\u5510\u5b66\u8c26\u7684\u4f4f\u6240\uff0c\u5979\u5fc3\u91cc\u627f\u53d7\u7684\u538b\u529b\u4e00\u5b9a\u4f1a\u5f88\u5927\u3002\u4f46\u662f\u987e\u5efa\u840d\u5728\u573a\uff0c\u53c8\u4e0d\u597d\u591a\u8bf4\u4ec0\u4e48\u5b89\u6170\u7684\u8bdd\uff0c\u53ea\u5728\u51fa\u95e8\u7684\u65f6\u5019\u5728\u5979\u7684\u624b\u5fc3\u91cc\u634f\u4e86\u634f\uff0c\u5e0c\u671b\u5979\u80fd\u71ac\u8fc7\u63a5\u4e0b\u6765\u7684\u65e5\u5b50\u3002</p></article>"}}}]);
